import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { Chart } from 'react-chartjs-2';
import { CategoryScale } from 'chart.js';

Chart.register(CategoryScale);


ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
